import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons
import ListAlt from "@material-ui/icons/Chat";
import Search from "@material-ui/icons/VerifiedUser";
import Redeem from "@material-ui/icons/Fingerprint";
// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import InfoArea from "components/InfoArea/InfoArea.js";

import styles from "assets/jss/material-kit-react/views/quizPageSections/quizStyle.js";

const useStyles = makeStyles(styles);

export default function ProductSection() {
  const classes = useStyles();
  return (
    <div className={classes.section}>
        <h2>You enjoy vibrate, social gatherings</h2><br />
        <GridContainer>
          <GridItem xs={12} sm={12} md={4}>
            <Button>Not at all</Button>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Button>Not very much</Button>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Button>Neutral</Button>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Button>Somewhat</Button>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Button>Very Much</Button>
          </GridItem>
        </GridContainer>
      </div>
  );
}
